/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `numP`( in datc char(32))
BEGIN
	SET @dat = datc;
	SET @touB = '00:00:00';
	SET @weiB = '23:59:59';
	SET @Tou = CONCAT_WS(' ',@dat,@touB);
	SET @Wei = CONCAT_WS(' ',@dat,@weiB);
	set @zong = 0;
	-- 
	SELECT COUNT(*) into @zong FROM newuseraccounts WHERE ADDDATE >= @Tou AND ADDDATE <= @Wei ;
	-- pc
	SELECT COUNT(*), @zong FROM newuseraccounts WHERE (ChannelType = 'pcdandan') AND (ADDDATE >= @Tou AND ADDDATE <= @Wei);
    END */$$
