		CHAR(ROUND((RAND())*25)+97),
		CHAR(ROUND((RAND())*25)+97),
		CHAR(ROUND((RAND())*9)+48),
		CHAR(ROUND((RAND())*9)+48),
		CHAR(ROUND((RAND())*9)+48),
		CHAR(ROUND((RAND())*9)+48)
		)) WHERE id = (577+ i);
		SET i = i + 1;
	END WHILE;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `updateProp` */

/*!50003 DROP PROCEDURE IF EXISTS  `updateProp` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `updateProp`(useridx VARCHAR(32),propidx int(4),propcountx int(10),roomidx int(10),typex INT(1))
BEGIN
	DECLARE recordcount INT DEFAULT 0;
	DECLARE prop_before_count INT DEFAULT 0;
	DECLARE prop_after_count INT DEFAULT 0;
	SELECT COUNT(*) INTO recordcount FROM gameaccount.prop_item WHERE userid = useridx AND propid = propidx;
	IF recordcount > 0 THEN
		SELECT propcount INTO prop_before_count FROM gameaccount.prop_item WHERE userid = useridx AND propid = propidx;
		UPDATE gameaccount.prop_item SET propcount = propcount + propcountx WHERE userid = useridx AND propid = propidx;
		SELECT propcount INTO prop_after_count FROM gameaccount.prop_item WHERE userid = useridx AND propid = propidx;
	ELSE
		INSERT INTO gameaccount.prop_item(userid,propid,propcount) VALUES(useridx,propidx,propcountx);
		SELECT propcount INTO prop_after_count FROM gameaccount.prop_item WHERE userid = useridx AND propid = propidx;
	END IF;
	/*  */
	INSERT INTO gameaccount.`prop_changelog`(userid,propid,change_before,change_count,change_after,gameid,codeid) VALUES(useridx,propidx,prop_before_count,propcountx,prop_after_count,roomidx,typex);
	
    END */$$
DELIMITER ;

/* Procedure structure for procedure `updateRecharge` */

/*!50003 DROP PROCEDURE IF EXISTS  `updateRecharge` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `updateRecharge`(out_trade_nox VARCHAR(30))
BEGIN
	SELECT state INTO @state FROM recharge WHERE out_trade_no = out_trade_nox;
	IF @state = 0 THEN
		UPDATE recharge SET state = 1 WHERE out_trade_no = out_trade_nox;
	 	SELECT * FROM recharge WHERE out_trade_no = out_trade_nox;
	ELSE
	 	SELECT 2 AS rcode;
	END IF;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `useLoginCode` */

/*!50003 DROP PROCEDURE IF EXISTS  `useLoginCode` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `useLoginCode`(logincodex VARCHAR(40))
BEGIN
	SET @loginidx = 0;
	SET @timeL = "";
	SET @flag = 1;
	SET @k = 0;
	SET @scorex = 0;
	SET @userIdx = 0;
	SET @dtimex = "";
	SET @dcountx = 0;
	
	SET @maxcount = 2;
	SET @addScore = 50;
	SELECT loginid,loginDate INTO @loginidx,@timeL FROM logintemp WHERE logincode = logincodex;
	SELECT TIMESTAMPDIFF(DAY,@timeL,NOW()) INTO @flag;
	IF @flag = 0 THEN
		SELECT score,Id INTO @scorex,@userIdx FROM newuseraccounts WHERE Id=@loginidx;
		/**/
		IF @scorex < 50 AND flagx THEN
			SET @zaixian = (SELECT COUNT(*) FROM lineout WHERE userId = @userIdx);
			IF @zaixian = 0 THEN
				/**/
				SELECT dtime,dcount INTO @dtimex,@dcountx FROM dongshanzaiqi WHERE userId = @loginidx;
				IF @dtimex THEN
					/*,*/
					IF TO_DAYS(@dtimex)=TO_DAYS(NOW()) THEN
						IF @dcountx < @maxcount THEN
							UPDATE dongshanzaiqi SET dcount=dcount+1 WHERE userId = @userIdx;
							SET @k = @dcountx + 1;
							UPDATE newuseraccounts SET score=score+@addScore WHERE Id = @userIdx;
						ELSE
							/**/
							SET @k = 0;
						END IF;
					ELSE
						/**/
						UPDATE dongshanzaiqi SET dtime=NOW(),dcount=1 WHERE userId = @userIdx;
						SET @k = 1;
						UPDATE newuseraccounts SET score=score+@addScore WHERE Id = @userIdx;
					END IF;
				ELSE
					/**/
					INSERT INTO dongshanzaiqi(userId,dcount) VALUES(@userIdx,1);
					SET @k = 1;
					UPDATE newuseraccounts SET score=score+@addScore WHERE Id = @userIdx;
				END IF;
			ELSE
				/**/
				SET @k = 0;
			END IF;
		ELSE
			/**/
			SET @k = 0;
		END IF;
		
		SELECT *,1 AS rcode,@k AS 'k' FROM newuseraccounts WHERE Id=@loginidx;
	ELSE
		SELECT 0 AS rcode;
	END IF;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `weixinCreateUser` */

/*!50003 DROP PROCEDURE IF EXISTS  `weixinCreateUser` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `weixinCreateUser`(Accountx VARCHAR(50),Passwordx VARCHAR(32),nicknamex VARCHAR(40),scorex INT(20),px VARCHAR(20),phoneNox VARCHAR(13),emailx VARCHAR(20),sexx INT(1),cityx VARCHAR(20),countryx VARCHAR(20),provincex VARCHAR(20),headimgurlx VARCHAR(200),languagex VARCHAR(10),logincodex VARCHAR(40),ChannelTypex VARCHAR(30),bindUserId VARCHAR(30),did VARCHAR(20))
BEGIN
	SET @recordcount = 0;
	set @rcode = 0;
	SELECT Id INTO @recordcount FROM newuseraccounts WHERE Account = Accountx;
	IF @recordcount <= 0 THEN
		INSERT INTO newuseraccounts(Account,PASSWORD,nickname,score,p,phoneNo,email,sex,city,province,country,headimgurl,LANGUAGE,ChannelType) VALUES(Accountx,Passwordx,nicknamex,scorex,px,phoneNox,emailx,sexx,cityx,provincex,countryx,headimgurlx,languagex,ChannelTypex);
		SELECT Id INTO @recordcount FROM newuseraccounts WHERE Account = Accountx;
		INSERT INTO userInfo(userId,firstexchange) values(@recordcount,0);
		IF NOT ISNULL(bindUserId) THEN
			SELECT COUNT(*) INTO @isflag FROM pcdandan WHERE pcdandanId = bindUserId;
			IF @isflag = 0 THEN
				INSERT INTO pcdandan(userId,pcdandanId,Devid) VALUES(@recordcount,bindUserId,did);			
			END IF;
		 	SET @rcode = 1;
		END IF;
	END IF;
	
	SET @logintempCount = 0;
	/**/
	SELECT COUNT(*) INTO @logintempCount FROM logintemp WHERE loginid = @recordcount;
	IF (@logintempCount > 0) THEN
		UPDATE logintemp SET logincode = logincodex WHERE loginid = @recordcount;
	ELSE
		INSERT INTO logintemp(loginid,logincode) VALUES(@recordcount,logincodex);
	END IF;
	
	
	if @rcode = 1 then
		select @recordcount as rcode;
	else
		select 0 as rcode;
	end if;
    END */$$
DELIMITER ;

